// import logo from './logo.svg';
import React from 'react';
import './MainContainer.css';



class MainContainer extends React.Component {
  constructor(props) {
    super(props)
    this.heading = props.heading;
    this.className = props.className;
    this.children = props.children;
  }



  render() {
    return (
      <div className={this.className}>
        {this.heading}
        {this.children}
      </div>
    )
  }
}

class CardSmall extends React.Component {
  constructor(props) {
    super(props)
    this.heading = props.heading;
    this.className = props.className;
    this.description = props.description;
    this.cta = props.cta;
  }


  render() {
    return (
      <MainContainer heading='This is the heading'>
        <div className={this.className}>
          <h2>{this.heading}</h2>
          <h2>{this.description}</h2>
          <h2>{this.cta}</h2>
        </div>
      </MainContainer>
    )
  }
}

function allSmallCards() {
  return (
    <CardSmall className="cardSmall" heading="I\'m the heading" description="I'm the description" cta="CTA" />
  )
}


export default allSmallCards
